    "id": "CVE-2024-6197",
    "dataSource": "https://access.redhat.com/security/cve/CVE-2024-6197",
    "namespace": "redhat:distro:redhat:10",
    "severity": "Medium",
    "urls": [],
    "description": "A vulnerability was found in cURL's utf8asn1str() function in the ASN1 parser, which causes a denial of service due to a memory allocation flaw. This flaw allows a remote attacker to use a specially crafted TLS certificate, causing the function to invoke free() on a 4-byte local stack buffer. While most modern malloc implementations detect and abort this error, some accept the pointer, leading to stack memory overwriting. This flaw likely results in a crash, though more serious consequences are possible in certain conditions.",
